wikitext.*:
本模板用于处理以冒号分隔的系列条目字符串。默认取冒号后面，即条目名。也可以设置第二个参数为1，取系列名。没有冒号返回原字符串。

相关模板：{{tl|Trim_suffix}}

==例子==

 <nowiki>{{Trim_prefix|水浒杀:张清}}</nowiki>
{{Trim_prefix|水浒杀:张清}}

 <nowiki>{{Trim_prefix|萌娘百科:万物皆可萌|1}}</nowiki>
{{Trim_prefix|萌娘百科:万物皆可萌|1}}

 <nowiki>{{Trim_prefix|林冲}}</nowiki>
{{Trim_prefix|林冲}}

==扩展用法==
*可设置参数c为其他分隔字符

 <nowiki>{{Trim_prefix|c=/|舰队Collection/图鉴}}</nowiki>
{{Trim_prefix|c=/|舰队Collection/图鉴}}

 <nowiki>{{Trim_prefix|c=#|舰队Collection:金刚#台词}}</nowiki>
{{Trim_prefix|c=#|舰队Collection:金刚#台词}}

